    <div class="container">
    <form id="form1" runat="server">
        <div id="options">
            <div class="column">
             <label for="upload">Upload Image</label>     
             <input type='file' id="imgInp" name="upload" />
             <label for="quantity">Initial Price</label>  
             <input id="initialprice" type='number' step="0.01"  name="initialprice" placeholder="0.00" value="1.00">

           </div>

             <input id="stke" type='number' name="strike" placeholder="240" value="240">
             <label for="date">Date</label> 
             <input type="date" id="dte" name="date">

             <input type="checkbox" id="isweekly" name="isweekly">
             <label for="option">Option</label> 
             <select name="option" id="opt">
                 <option value="Call" selected>Call</option>
                 <option value="Put">Put</option>
               </select>
               <label for="position">Position Ratio</label> 
             <input id="position" type='number' step="0.01"  name="position" placeholder="100.00" value="100.00">
           </div>
           </div>
        </form>
